/**
 * A simple extend function for classes
 */
function extend(to, from) {
	if (from) {
		for (var key in from) {
			if (from.hasOwnProperty(key)) {
				to[key] = from[key];
			}
		}
	} 
	return to;
}	

/**
 * Method used to allow callbacks to be made from the viewer 
 */
function enableCallback(obj,root,opts,conf){
	extend(obj, {
			
		getRoot: function() {
			return root;	
		},
		
		getOptions: function() {
			return opts;	
		},

		
		getConf: function() {
			return conf;	
		}, 
		
		getApi: function() {
			return root.firstChild;	
		}
		
	}); 
}

